script: |
  super -f text -I q6431.spq | sort > q6431.out

inputs:
  - name: q6431.spq
    data: |
      SELECT - col0 FROM tab0 (FORMAT parquet) WHERE ( - 24 ) * + col2 * - 23 * - - col2 * + + col1 NOT BETWEEN + col0 AND - col1;
  - name: tab0

outputs:
  - name: q6431.out
    data: |
      -15
      -87
      -97
